import React from 'react';
import {
  Grid,
  Paper,
  List,
  ListItem,
  ListItemText,
  Link
} from '@mui/material';
import CustomImageAvatar from '../components/CustomImageAvatar';
import SwipeableTextMobileStepper from '../components/SwipeableTextMobileStepper.js';
import '../style/HomePage.css';
import avatar from '../images/avatar.png';

function HomePage() {
  return (
    <div className="HomePage">
      <header className="HomePage-header">

        <div className="center-container">
          <CustomImageAvatar size={220} imgPath={avatar} className="centered-avatar" />
        </div>

        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} sm={7} className="grid-left">
            <Paper sx={{backgroundColor:"transparent"}} elevation={0} className="avatar-container">
              <SwipeableTextMobileStepper></SwipeableTextMobileStepper>
            </Paper>
          </Grid>

          <Grid item xs={12} sm={5} className="grid-right">
            <List component="nav" className="vertical-menu">
              <ListItem button className="vertical-menu-item">
                <Link href="#" primary="Menu Item 1" className="menu-text"></Link>
              </ListItem>
              <ListItem button className="vertical-menu-item">
                <ListItemText primary="Menu Item 2" className="menu-text"/>
              </ListItem>
              <ListItem button className="vertical-menu-item">
                <ListItemText primary="Menu Item 3" className="menu-text"/>
              </ListItem>
              {/* Add more menu items as needed */}
            </List>
          </Grid>
        </Grid>
      </header>
    </div>
  );
}

export default HomePage;
